{ "event": "bestChainBlockIncluded", "block": { "hash": "...", "index": ... }
} Or { "event": "bestChainBlockIncluded", "block": null
} The bestChainBlockIncluded event indicates which block of the best chain the transaction is included in. null can be sent back in case the block is no longer in any block of the best chain. This is the state a transaction starts in. hash is a string containing the hexadecimal-encoded hash of the header of the block. index is an integer indicating the 0-based index of this transaction within the body of this block. If multiple bestChainBlockIncluded events happen in a row, the JSON-RPC server is allowed to skip all but the last. Note : Please note that these is no guarantee that the mentioned block matches any of the blocks returned by chainHead_unstable_follow.

