The format of the finalizedBlockRuntime and newRuntime fields can be one of: valid { "type": "valid", "spec": { "specName": ..., "implName": ..., "specVersion": ..., "implVersion": ..., "transactionVersion": ..., "apis": [...], }
} In normal situations, the type is valid. The fields of spec are: specName: Opaque string indicating the name of the chain. implName: Opaque string indicating the name of the implementation of the chain. specVersion: Opaque integer. The JSON-RPC client can assume that the call to Metadata_metadata will always produce the same output as long as the specVersion is the same. implVersion: Opaque integer. Whenever the runtime code changes in a backwards-compatible way, the implVersion is modified while the specVersion is left untouched. transactionVersion: Opaque integer. Necessary when building the bytes of a transaction. Transactions that have been generated with a different transactionVersion are incompatible. apis: Object containing a list of "entry point APIs" supported by the runtime. Each key is an opaque string indicating the API, and each value is an integer version number. Before making a runtime call (using chainHead_unstable_call), you should make sure that this list contains the entry point API corresponding to the call and with a known version number. Note : In Substrate, the keys in the apis field consists of the hexadecimal-encoded 8-bytes blake2 hash of the name of the API. For example, the TaggedTransactionQueue API is 0xd2bc9897eed08f15. Note : The format of apis is not the same as in the legacy JSON-RPC API. Note : The list of fields is only a subset of the list of so-called "runtime specification" found in the runtime. The fields that aren't useful from a JSON-RPC client perspective are intentionally not included. Example value { "specName": "westend", "implName": "parity-westend", "specVersion": 9122, "implVersion": 0, "transactionVersion": 7, "apis": { "0xdf6acb689907609b": 3 "0x37e397fc7c91f5e4": 1, "0x40fe3ad401f8959a": 5, "0xd2bc9897eed08f15": 3, "0xf78b278be53f454c": 2, "0xaf2c0297a23e6d3d": 1, "0x49eaaf1b548a0cb0": 1, "0x91d5df18b0d2cf58": 1, "0xed99c5acb25eedf5": 3, "0xcbca25e39f142387": 2, "0x687ad44ad37f03c2": 1, "0xab3c0572291feb8b": 1, "0xbc9d89904f5b923f": 1, "0x37c8bb1350a9a2a8": 1 }
